import React from "react";
import Header from "./header";

const Dashboard = () => {
  return (
    <>
      <Header />
      <div className="conatiner">
        <div className="row">
          <div className="col-lg-3">Friends</div>
        </div>
      </div>
    </>
  );
};

export default Dashboard;
